CREATE DATABASE QuickJobs;
USE QuickJobs;
CREATE TABLE Vagas (
	ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Titulo VARCHAR(255),
    Empresa VARCHAR(255),
    Descricao VARCHAR(500),
    Link VARCHAR(255),
    Salario VARCHAR(255),
    Imagem LONGTEXT
);


